export class ComplicationHypothyroidie
{
    PatientId:number;
    Hypothyroidie:boolean;
    AgeApparitionHypothyroidie:number;
    TraitementHypothyroidie:boolean;
    Specification:string;
    constructor()
    {
        this.PatientId=0;
        this.Hypothyroidie=false;
        this.AgeApparitionHypothyroidie=0;
        this.TraitementHypothyroidie=false;
        this.Specification='';

    }
}
